"""Definimos la interface Animal con su respectiva clase Mascota y resolviendo la relaci√≥n de composici√≥n con la clase Persona

![image.png](data:image/png;base64,)
"""

from abc import ABC, abstractmethod
from datetime import date

class Animal(ABC):
    def __init__(self, nombre):
        self.nombre = nombre

    @abstractmethod
    def sonido(self):
        pass


class Mascota(Animal):
    # Constructor con argumento nacimiento como no obligatorio
    def __init__(self, nombre, persona_amo, nacimiento=date.today()):
        super().__init__(nombre)
        self.amo = persona_amo
        self.nacimiento = nacimiento

    def sonido(self):
        pass

    def edad(self):
        edad = date.today() - self.nacimiento
        return round(edad.days / 365)

# Instanciamos la clase Mascota para crear el objeto

mascota_firulay = Mascota("Firulay", persona_juan, nacimiento=date(2020, 1, 1))

# Pruebas
edad = mascota_firulay.edad()
print(edad)

# Prueba de abstracci√≥n
