"""Para resolver la relaci√≥n de asociaci√≥n entre las clases Gato y Persona, se ha implementado el m√©todo mascotas, el cual lista las mascotas que le pertenece a una persona en particular, en general se recomienda evitar el uso de las asociaciones ya que su implementaci√≥n puede resultar no muy clara o directa.

![image.png](data:image/png;base64,)
"""

# Redefinimos la clase Persona con el fin de desarrollar el m√©todo mascotas
class Persona:

    # consutructor de la clase
    def __init__(self, dni, nombres, apellidos):
        # El atributo __dni es privado, es decir, no se puede accesar desde
        # fuera de la clase Persona. Todos los atributos que inician con __ son privados
        self.__dni = dni
        self.nombres = nombres
        self.apellidos = apellidos

    def get_dni(self):
        return self.__dni

    def mascotas(self, lista_de_mascotas):
        mascotas = []
        for mascota in lista_de_mascotas:
            if mascota.amo == self:
                mascotas.append(mascota.nombre)
        return mascotas

# Instanciamos la clase Persona para crear el objeto
juan = Persona(12345678, "Juan", "Perez")

# Asignamos a juan como due√±o de firulays
firulays.amo = juan

# Verificamos la asociaci√≥n por medio del m√©todo mascotas
juan.mascotas([firulays, garfield])